import React from "react"
import GsapMagnetic from "../GsapMagnetic"
import { useNavigate } from 'react-router-dom'

function MenuEl({ href, text, currentMenuEl, id, menuElHandle }) {
  const navigate = useNavigate();
  const [active, setActive] = React.useState(false);

  const handleClick = (link) => {
    setTimeout(() => {
      navigate(link);
      setActive(true);
    }, 500);
  };

  React.useEffect(() => {
    console.log(id, currentMenuEl);
  }, []);

  return (
    <GsapMagnetic>
      <button
        onClick={(e) => handleClick(href)}
        className={currentMenuEl === id ? "active" : ""}>
        <span>{text}</span>
        <span className="dot"></span>
      </button>
    </GsapMagnetic>
  );
}
  
export default MenuEl;
